import React from 'react';
import Carts from './Carts';
import Details from './details';
import {
  BrowserRouter as Router,
  Switch,
  Route,Link
} from "react-router-dom";


//const Cards = arr.map((item) => <Carts data={item} />)
export default function Data({data}) {

  return (
    <Router>
        <Switch>
                <Route path="/">
                <Carts  data={data} />
                </Route>
                <Route path="/details">
                <Details/>
                </Route>
          </Switch>
      </Router>
  )


}
